import React from 'react'

function User() {

   const addUser = (event)=>{
      event.preventdefault()
   }

  return (
    <form >
        <label>User name :</label>
        <input type="text"/>
        <label>Email : </label>
        <input type="text"/>
        <button type="submit" onClick={addUser}>Add User</button>
    </form>
  )
}

export default User
